import axios from 'axios'
import { useState } from 'react'

const RandomCatThings =()=>{

    const [nfo, setNfo]=useState('You will see nfos here');

    axios('https://cat-fact.herokuapp.com/facts')  .then((res) =>setNfo(res.data.all[0].text))
    return (
        "Random cat things",
        {nfo}
    );
}

export default RandomCatThings
